// Footer.js

import React from 'react';
import { Container, Grid, Typography, Link, IconButton } from '@mui/material';
import { makeStyles } from '@mui/styles';
import { Facebook, Twitter, Instagram } from '@mui/icons-material';

const useStyles = makeStyles((theme) => ({
  footer: {
    backgroundColor: '#333',
    color: '#fff',
    padding: theme.spacing(4, 0),
  },
  socialIcons: {
    '& > *': {
      marginRight: theme.spacing(1),
      color: '#fff',
    },
  },
  bottomBar: {
    backgroundColor: '#222',
    color: '#fff',
    padding: theme.spacing(1, 0),
    textAlign: 'center',
  },
}));

const Footer = () => {
  const classes = useStyles();

  return (
    <footer className={classes.footer}>
      <Container maxWidth="lg">
        <Grid container spacing={3}>
          <Grid item xs={12} sm={6}>
            <Typography variant="h6">About Us</Typography>
            <Typography variant="body1">This is the footer section of our blog website. You can add some information about your blog here.</Typography>
          </Grid>
          <Grid item xs={12} sm={6}>
            <Typography variant="h6">Connect With Us</Typography>
            <div className={classes.socialIcons}>
              <IconButton href="#" aria-label="Facebook"><Facebook /></IconButton>
              <IconButton href="#" aria-label="Twitter"><Twitter /></IconButton>
              <IconButton href="#" aria-label="Instagram"><Instagram /></IconButton>
              {/* Add more social media icons as needed */}
            </div>
          </Grid>
        </Grid>
      </Container>
      <div className={classes.bottomBar}>
        <Container maxWidth="lg">
          <Typography variant="body2">&copy; 2024 Your Blog Name. All rights reserved.</Typography>
        </Container>
      </div>
    </footer>
  );
};

export default Footer;
